export class AddupdatepaycodeComponent extends ParentSystemSetupComponent {
  constructor(fb, apiService, authService, utilService, notifyService, dialog, pageService, dialogRef) {
    super(authService);
    this.fb = fb;
    this.apiService = apiService;
    this.authService = authService;
    this.utilService = utilService;
    this.notifyService = notifyService;
    this.dialog = dialog;
    this.pageService = pageService;
    this.dialogRef = dialogRef;
    this.id = 0;
    this.branchCodeControl = new FormControl();
    this.iACControl = new FormControl();
    this.pDCControl = new FormControl();
    this.isCheckBookAdded = false;
    this.canShowCheckBookAdded = false;
    this.isBranchLoading = false;
    this.isIACLoading = false;
    this.isPDCLoading = false;
    this.branchCodeError = '';
    this.payCodeTypeList = [];
    this.filteredOptions = this.branchCodeControl.valueChanges.pipe(startWith(''), debounceTime(400), distinctUntilChanged(), switchMap(val => {
      if (val.trim() !== '') this.isBranchLoading = true;
      return this.filter(val || '');
    }));
    this.filteredIACOptions = this.iACControl.valueChanges.pipe(startWith(''), debounceTime(400), distinctUntilChanged(), switchMap(val => {
      if (val.trim() !== '') this.isIACLoading = true;
      return this.filterIAC(val || '');
    }));
    this.filteredPDCOptions = this.pDCControl.valueChanges.pipe(startWith(''), debounceTime(400), distinctUntilChanged(), switchMap(val => {
      if (val.trim() !== '') this.isPDCLoading = true;
      return this.filterPDC(val || '');
    }));
  }

  ngOnInit() {
    this.setForm();
    this.loadData();
    if (this.id > 0) this.setEditForm();
  }

  loadData() {
    this.apiService.getall("paymentcodes/getSelectPaymentTypeList").subscribe(res => {
      if (res) this.payCodeTypeList = res;
    });
  }

  setForm() {
    //let cDate: IMyDateModel = { isRange: false, singleDate: {}, dateRange: null };
    this.form = this.fb.group({
      'finPayType': ['', Validators.required],
      'finPayCode': ['', Validators.required],
      'finPayName': ['', Validators.required],
      // 'finPayAcIntgrAC': ['', Validators.required],
      // 'finPayPDCClearAC': ['', Validators.required],
      'isActive': [false],
      'useByOtherBranches': [false],
      'systemGenCheckBook': [false]
    });
  }

  filter(val) {
    return this.apiService.getall(`branch/getSelectSysBranchList?search=${val.trim()}`).pipe(map(response => {
      const res = response; //if (res && res.length == 0)
      //  this.notifyService.showError("enter branch name")

      this.isBranchLoading = false;
      return res;
    }));
  }

  filterIAC(val) {
    return this.apiService.getall(`accountscategory/getSelectMainIntegrationAccountList?search=${val}`).pipe(map(response => {
      const res = response; //if (res && res.length == 0)
      //  this.notifyService.showError("enter branch name")

      this.isIACLoading = false;
      return res;
    }));
  }

  filterPDC(val) {
    return this.apiService.getall(`accountscategory/getSelectMainPdcAccountList?search=${val}`).pipe(map(response => {
      const res = response; //if (res && res.length == 0)
      //  this.notifyService.showError("enter branch name")

      this.isPDCLoading = false;
      return res;
    }));
  }

  blurBranchCode(event) {
    this.apiService.getall(`branch/checkBranchCode?branchCode=${event.target.value}`).subscribe(res => {
      if (!res) {
        //if (!this.isOptionSelected) {
        //this.isOptionSelected = false;
        this.branchCodeControl.setValue('');
        this.branchCodeError = "Select BranchCode";
        this.form.patchValue({
          'finBranchName': '',
          'finBranchAddress': ''
        }); //}
      }
    });
  }

  selectedOption(event) {
    this.branchCodeError = ''; // this.branchCodeControl.setValue(event.option.value);
  }

  payCodeSelect(event) {
    const payCodeId = event.target.value;

    if (this.utilService.hasValue(payCodeId)) {
      if (payCodeId === '1') {
        this.canShowCheckBookAdded = true;
      } else this.canShowCheckBookAdded = false;
    }
  }

  branchcodeBlur(event) {
    if (event.target.value && event.target.value !== '') {
      this.apiService.getall(`branch/getBranchByBranchCode?branchCode=${event.target.value}`).subscribe(res => {}, error => {
        this.branchCodeControl.setValue('');
      });
    }
  } //checkBookForBankOptions: Array<string> = [];


  openDialogManage(id = 0, dbops, modalTitle, modalBtnTitle, checkResult) {
    let dialogRef = this.utilService.openCrudDialog(this.dialog, BankcheckbookComponent); //(dialogRef.componentInstance as any).dbops = dbops;
    //(dialogRef.componentInstance as any).modalTitle = modalTitle;
    //(dialogRef.componentInstance as any).modalBtnTitle = modalBtnTitle;

    if (id > 0) dialogRef.componentInstance.checkValue = checkResult;
    dialogRef.afterClosed().subscribe(res => {
      if (res && res.hasValue === true) {
        this.isCheckBookAdded = true;
        Object.keys(res.value).forEach(key => {
          //if (this.utilService.hasValue(res.value[key]))
          this.form.value[key] = res.value[key];
        }); //console.log(res.value)
      } else this.isCheckBookAdded = false;
    });
  }

  create() {
    localStorage.setItem('paycodeCheckvalue', JSON.stringify(this.checkRes));
    this.openDialogManage(0, DBOperation.create, '', '', this.checkRes);
  }

  checkBookForBank() {
    const payCodeType = +this.form.value['finPayType'];

    if (payCodeType === 1) {
      if (!this.isCheckBookAdded) {
        this.notifyService.showError('Add CheckBook for Bank');
        return false;
      }
    }

    return true;
  }

  setEditForm() {
    this.apiService.get('paymentcodes/getPayCodeById', this.id).subscribe(res => {
      if (res) {
        this.checkRes = res; //this.form.setValue(res['companyName']);

        this.branchCodeControl.setValue(res['finBranchCode']);
        this.iACControl.setValue(res['finPayAcIntgrAC']);
        this.pDCControl.setValue(res['finPayPDCClearAC']);
        this.form.patchValue(res);
        const payCodeId = res['finPayType'];

        if (payCodeId === '1') {
          this.isCheckBookAdded = true;
          this.canShowCheckBookAdded = true;
          this.form.value['stChkNum'] = res['stChkNum'];
          this.form.value['endChkNum'] = res['endChkNum'];
          this.form.value['checkLeavePrefix'] = res['checkLeavePrefix'];
        } else this.canShowCheckBookAdded = false;
      }
    });
  }

  submit() {
    if (this.form.valid) {
      if (!this.checkBookForBank()) return;
      if (this.id > 0) this.form.value['id'] = this.id;
      let finBranchCode = this.branchCodeControl.value;
      let finPayAcIntgrAC = this.iACControl.value;
      let finPayPDCClearAC = this.pDCControl.value;

      if (this.utilService.hasValue(finBranchCode) && this.utilService.hasValue(finPayAcIntgrAC) && this.utilService.hasValue(finPayPDCClearAC)) {
        this.form.value['finBranchCode'] = finBranchCode;
        this.form.value['finPayAcIntgrAC'] = this.utilService.removeSqueres(finPayAcIntgrAC);
        this.form.value['finPayPDCClearAC'] = this.utilService.removeSqueres(finPayPDCClearAC); //console.log(this.form);

        this.apiService.post('paymentcodes', this.form.value).subscribe(res => {
          this.utilService.OkMessage();
          this.form.reset();
          this.dialogRef.close(true);
        }, error => {
          this.utilService.ShowApiErrorMessage(error);
        });
      } else this.utilService.FillUpFields();
    } else this.utilService.FillUpFields();
  }

  closeModel() {
    this.dialogRef.close();
  }

}

